import './App.css';
import { BrowserRouter as Router , Routes , Route } from 'react-router-dom';

import {Header,Footer, Home, Orders, Shop, Contact, Search, Wishlist, Cart , UpdateUser, UserRegister , UserLogin} from './component/index';

function App() {
  return (
    <>
      <Router>
        <Header />
        <Routes>
          <Route path='/' element={<Home />}/>
          <Route path='/orders' element={<Orders />}/>
          <Route path='/shop' element={<Shop />}/>
          <Route path='/contact' element={<Contact />}/>
          <Route path='/search' element={<Search />}/>
          <Route path='/wishlist' element={<Wishlist />}/>
          <Route path='/cart' element={<Cart />}/>
          <Route path='/update_user' element={<UpdateUser />}/>
          <Route path='/user_register' element={<UserRegister />}/>UserLogin
        </Routes>
        <Footer />
      </Router>
    </>
  );
}

export default App;
